import React from 'react';
import './cart.css'

const CartPage = () => {
    return ( 
        <div className="cartPage">
            <div  className="cartTitle">
                <img className="cartLogo" src={require('./cart.png')} alt="icehockey" />
                    <div>Your Cart</div>
                <img className="cartLogo" src={require('./cart.png')} alt="icehockey" />
            </div>

            <ul className="itemList">
                Your Items:<br/><br/>
                <li>Item 1</li>
                <li>Item 1</li>
                <li>Item 1</li>
                <li>Item 1</li>
                <li>Item 1</li>
                <li>Item 1</li>
            </ul>
        </div>
     );
}
 
export default CartPage;
